id: lessonpart6
title: ☠️ The Venomancer
content: |+
  ![1.00](data:image/jpeg;base64,)

  *The arena glows a sickly green as the gates creak open. A thin, sly snake slithers out, leaving trails of glowing mist. All around, strange food appears — some fresh and ripe, others dark and poisonous.*

  **The Venomancer**\
  Heheheh… hungry, are we? Too bad you can’t tell the food from the poison. Eat up, little fool.

  *It scatters poison food across the floor, cackling gleefully.*

  **SnakeBot**\
  (disgusted) Ugh, you’ve got to be kidding me. If I grab the wrong bite, I’m done for!

  **The Venomancer**\
  (laughing wildly) You’ll never resist! The hungrier you get, the more tempting it becomes! I don't even need a strategy, you'll lose on your own!

  *SnakeBot coils anxiously, glaring at the pit of food.*

  **SnakeBot**\
  Alright partner, you’ll need to tell me what to do and what *not* to do. This is next level prompting! Don't forget how we've been winning up to this point: **Observe, prompt, repeat.** We got this!

  > \[!TIP]
  > Prompt Challenge Instructions
  > Start by start by testing your current strategy against your opponent. Click the ✨ button to generate code and see your strategy in action!. If the strategy doesn't work, modify your prompt in the `prompt.md` file. You’ll see the generated code appear in the `player-ai.js` file.

